  render() {
    return (
      <div className='c'>
        <div className='row'>
          <div className='col-10 mx-auto text-center text-title text-uppercase pt-5'>
            <h1 className='display-3'>
              <h1>error</h1>
              <h2>Page Not Found</h2>
              <h3>
                the requested URL
                <span className='text-danger'>
                  {this.props.location.pathname}
                </span>{' '}
                was not found
              </h3>
            </h1>
          </div>
        </div>
      </div>
    );
  }
}

export default Default;
